अब अपने कंप्यूटर पर टिक टीएसी को पैर की अंगुली खेलना चाहते हैं? {{}

अपने दोस्तों के साथ इस खेल को खेलना चाहते हैं? आप आज इस सॉफ़्टवेयर को स्थापित करने के बाद ऐसा कर सकते हैं और खेलना शुरू कर सकते हैं
टिक टीएसी को पैर की अंगुली।

यदि आपके पास खेलने के लिए कोई नहीं है, तो अभी कंप्यूटर प्रतिद्वंद्वी को चुनौती दें। आज टिक टीएसी को पैर की अंगुली खेलें! {{}

कंप्यूटर की कठिनाई निर्धारित करें और देखें कि क्या आप उसे सबसे कठिन स्तर पर हरा सकते हैं। {२}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। टिक टीएसी को पैर की अंगुली का स्वामित्व नहीं है, इसके पास लाइसेंस नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
